import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import Datetoday from '../../Components/AllComponent/Datetoday.js'
import { ScrollView } from 'react-native';
import { useState } from 'react';
import Floorsection from './Roomcomponent/Floorsection';
import { Link } from 'react-router-dom';
import { Divider, Paper } from '@material-ui/core';
import { blue } from '@material-ui/core/colors';

const useStyles = makeStyles((theme) => ({
    frame: {
        width: '1163px',
        height: '105px',
        backgroundColor: 'red',
    },

    scrollspace: {
        height: "730px",
        width: '1163px',
        margin: 'auto',
        paddingLeft: 110,
        transition: 'all 0.5s ease'

    },
    scrollspace36: {
        height: "730px",
        width: '1163px',
        margin: 'auto',
        paddingLeft: 36,
        transition: 'all 0.5s ease'

    },
    paper: {
        width: '1163px',
        height: '494px',
        boxShadow: "0px 0px 0px #E8E8E8",
        borderRadius: 5,
        border: "1px solid #AAAAAA",
    },
    fameinfo: {
        width: 670,
        height: 310,
        background: 'red',
        display: 'absolute',
        float: 'right',
        marginTop: '32px',
        marginRight: '127px'   
    },
    famerow: {
        height: "59.86px",
        weight: "100%",
        backgroundColor: 'blue'
    }
}));

export default function Personalinfopage({isOpened}) {
    const classes = useStyles()
    return (
        <ScrollView>
        <div className={isOpened ? classes.scrollspace36 : classes.scrollspace}>
            <div>
                <div className={classes.frame}>
                    <Datetoday />
                </div>
                <Paper className={classes.paper}>
                    <div style={{height: '111.6px', width:'100%'}}>

                    </div>
                    <Divider/>
                    <div className={classes.fameinfo}>

                    </div>
                </Paper>
            </div>
        </div>
    </ScrollView>

    )
}
